        <div>
            <h1 id='title'>React Dynamic Table</h1>
            <table id='students'>
                <tbody>
                    <td>{id}</td>
                    <td>{name}</td>
                    <td>{value}</td>
                    <td>{change}</td>


                    {
                        Coins.map((coin, Index) => {
                            const { id, name, value, change } = coin //destructuring
                            return (
                                <tr key={id}>
                                    <td>{id}</td>
                                    <td>{name}</td>
                                    <td>{value}</td>
                                    <td>{change}</td>
                                </tr>)
                        })
                    }
                </tbody>
            </table>
        </div>
    )
    //exporting a component make it reusable and this is the beauty of react
};
